clear: .word 0x99D9EA,0x99D9EA,0x99D9EA,0x99D9EA,0x99D9EA,0x99D9EA
testing: .asciiz "Test"
 
.eqv BASE_ADDRESS 0x10008000
 

.globl main
.text

main:
    
    jal set_level1
    la $t1, game_data
    addi $sp,$sp, -4
    li $t0, 1
    sw $t0, 0($sp)
    sw $t0, 0($t1)
    addi,$sp,$sp, -4
    li $t0, 4
    sw $t0, 0($sp)
    sw $t0, 4($t1)
    jal get_x_y
    lw $t0, 0($sp) #pop coord
    addi $sp, $sp, 4
    addi $sp, $sp, -4 
    sw $t0, 0($sp)
    jal load_character
    jal keypressloop
    
    
    
keypressloop:
    li $v0, 32	# sleep
    li $a0, 65
    syscall
    jal process_jump
    jal process_gravity
    li $t9, 0xffff0000     # Load base address for keyboard MMIO
    
    # Check for keystroke event
    lw $t8, 0($t9)         # Load the value from the memory-mapped I/O
    beq $t8, 0, keypressloop       # Loop back if no key pressed
    
    # Load ASCII value of key pressed
    lw $t2, 4($t9)         # Load the ASCII value of the key pressed

    # Check for 'W' keypress
    li $t3, 0x77           # ASCII value for 'W'
    beq $t2, $t3, respond_to_w
    
    # Check for 'A' keypress
    li $t3, 0x61           # ASCII value for 'A'
    beq $t2, $t3, respond_to_a
    
    # Check for 'S' keypress
    li $t3, 0x73           # ASCII value for 'S'
    beq $t2, $t3, respond_to_s
    
    # Check for 'D' keypress
    li $t3, 0x64           # ASCII value for 'D'
    beq $t2, $t3, respond_to_d
    

    j keypressloop                # Jump back to main to check for next keypress
    
respond_to_w:
  
    la $t2, game_data
    lw $t0, 0($t2)
    lw $t1, 4($t2)
    addi $t1, $t1, 6
    addi $sp,$sp, -4
    sw $t0, 0($sp)
    addi $sp,$sp, -4
    sw $t1, 0($sp)
    jal get_x_y
    lw $t0, 0($sp) #pop coord
    addi $sp, $sp, 4
    addi $sp, $sp, -4
    sw $t0, 0($sp)
 
    jal check_collision
    lw $t0, 0($sp) #pop coord
