check_collision:
	
	lw $t0, 0($sp)
	addi $sp, $sp 4
        
	li $t1, 0x99D9EA
	addi $sp, $sp, -4
	sw $ra, 0($sp)
	lw $t0, 0($t0)
	bne $t1, $t0, collision_true #goes 1 if collision true else 0
	
	 
	
	addi $sp, $sp, 4
